<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport"
    content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0">
  <title>WinLine</title>


  <style>
    article,
    aside,
    details,
    figcaption,
    figure,
    footer,
    header,
    hgroup,
    menu,
    nav,
    section {
      display: block
    }

    html,
    body,
    div,
    span,
    applet,
    object,
    iframe,
    h1,
    h2,
    h3,
    h4,
    h5,
    h6,
    p,
    blockquote,
    pre,
    a,
    abbr,
    acronym,
    address,
    big,
    cite,
    code,
    del,
    dfn,
    em,
    img,
    ins,
    kbd,
    q,
    s,
    samp,
    small,
    strike,
    strong,
    sub,
    sup,
    tt,
    var,
    b,
    u,
    i,
    center,
    dl,
    dt,
    dd,
    ol,
    ul,
    li,
    fieldset,
    form,
    label,
    legend,
    table,
    caption,
    tbody,
    tfoot,
    thead,
    tr,
    th,
    td,
    article,
    aside,
    canvas,
    details,
    embed,
    figure,
    figcaption,
    footer,
    header,
    hgroup,
    menu,
    nav,
    output,
    ruby,
    section,
    summary,
    time,
    mark,
    audio,
    video,
    button {
      margin: 0;
      padding: 0;
      border: 0;
      font-size: 100%;
      vertical-align: baseline;
      box-sizing: border-box;
      color: #fff
    }

    a:hover,
    button:hover {
      cursor: pointer;
      opacity: .6
    }

    .dnone {
      display: none
    }

    a {
      text-decoration: none
    }

    input {
      box-sizing: border-box
    }

    body {
      background: #f0f0f1;
      overflow: hidden
    }

    .content,
    .decor,
    .win {
      width: 100dvw;
      height: 100dvh;
      position: absolute;
      top: 0
    }

    .content img,
    .decor img,
    .win img {
      position: absolute
    }

    #finger {
      position: absolute;
      opacity: 0;
      transition: opacity .3s
    }

    #finger.show {
      opacity: 1
    }

    #speen {
      transform-origin: 50% 42%
    }

    #btn {
      cursor: pointer
    }

    .win {
      background-color: #00000080;
      -webkit-backdrop-filter: blur(5px);
      backdrop-filter: blur(5px);
      z-index: 0;
      opacity: 0;
      transition: opacity .3s;
      width: 100dvw;
      height: 100dvh
    }

    .win.show {
      z-index: 22;
      opacity: 1
    }

    .win img {
      position: absolute;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%) scale(1);
      animation: finalAnim 2s linear infinite alternate
    }

    @keyframes finalAnim {
      0% {
        transform: translate(-50%, -50%) scale(1)
      }

      to {
        transform: translate(-50%, -50%) scale(.9)
      }
    }

    .title {
      opacity: 0;
      transition: opacity .3s
    }

    .title.show {
      opacity: 1
    }

    .text {
      position: absolute;
      bottom: 1dvh;
      color: #000;
      text-align: center;
      width: 90dvw;
      left: 50%;
      transform: translate(-50%)
    }

    @media (max-aspect-ratio: 1/1) {
      .decor #ball {
        width: 15dvw
      }

      .decor #chipTop {
        width: 20dvw;
        right: -8dvw
      }

      .decor #chipCenter {
        display: none
      }

      .decor #chipBottom {
        width: 10dvw;
        bottom: 30dvh;
        right: 5dvw
      }

      .decor #cube,
      .decor #box {
        bottom: 4dvh;
        width: 20dvw
      }

      .decor #cube {
        right: -3dvw
      }

      .decor #box {
        left: -3dvw
      }

      .content .info,
      .content .right {
        width: 100dvw;
        position: relative
      }

      .content .info img,
      .content .right img {
        left: 50%;
        transform: translate(-50%)
      }

      .content .right {
        height: 40dvh;
        top: 50%;
        transform: translateY(-50%)
      }

      .content .logo {
        top: 5dvh;
        width: auto;
        height: 3dvh
      }

      .content .title {
        top: 13dvh;
        width: auto;
        height: 6dvh
      }

      .content .btn {
        top: 75dvh;
        width: auto;
        height: 8dvh
      }

      .content #finger {
        width: 15dvw;
        top: 82dvh;
        left: 70%;
        animation: fingerAnim 1.5s ease-in infinite alternate
      }

      @keyframes fingerAnim {
        0% {
          transform: translate(-50%) scale(1) rotate(0);
          top: 82dvh
        }

        to {
          transform: translate(-70%) scale(.8) rotate(-15deg);
          top: 78dvh
        }
      }

      .content svg {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        width: auto;
        max-width: 90dvw;
        max-height: 55dvh
      }

      .win img {
        width: 70dvw
      }

      .text {
        font-size: 1.2dvh
      }
    }

    @media (min-aspect-ratio: 1/1) {
      .decor #ball {
        width: 15dvw
      }

      .decor #chipTop {
        width: 10dvw;
        right: -4dvw
      }

      .decor #chipCenter {
        width: 15dvw;
        left: 35dvw;
        top: 25dvh
      }

      .decor #chipBottom {
        width: 8dvw;
        bottom: 5dvh;
        left: 30dvw
      }

      .decor #cube,
      .decor #box {
        bottom: 4dvh;
        width: 10dvw
      }

      .decor #cube {
        right: -3dvw
      }

      .decor #box {
        left: -3dvw
      }

      .content {
        display: flex
      }

      .content .info,
      .content .right {
        width: 50dvw;
        position: relative;
        left: 0
      }

      .content .info img,
      .content .right img {
        left: 50%;
        transform: translate(-50%) scale(1) rotate(0)
      }

      .content .info svg,
      .content .right svg {
        position: absolute;
        top: 10dvh;
        right: 7dvw;
        width: auto;
        height: 75dvh
      }

      .content .logo {
        top: 10dvh;
        width: 10dvw
      }

      .content .title {
        top: 35dvh;
        height: 8dvh
      }

      .content .btn {
        top: 50dvh;
        width: 20dvw
      }

      .content #finger {
        width: 8dvw;
        top: 59dvh;
        left: 70%;
        animation: fingerAnim 1.5s ease-in infinite alternate
      }

      @keyframes fingerAnim {
        0% {
          transform: translate(-50%) scale(1) rotate(0);
          top: 59dvh
        }

        to {
          transform: translate(-70%) scale(.8) rotate(-15deg);
          top: 50dvh
        }
      }

      .win img {
        height: 70dvh
      }

      .text {
        font-size: 1dvw
      }
    }

    .levitation {
      animation: levitation 6s linear infinite alternate
    }

    @keyframes levitation {
      0% {
        transform: translate(0) rotate(0)
      }

      to {
        transform: translate(-20%, 55%) rotate(45deg)
      }
    }

    .levitation2 {
      animation: levitation2 6s linear 1s infinite alternate
    }

    @keyframes levitation2 {
      0% {
        transform: translate(0)
      }

      to {
        transform: translate(35%, 55%)
      }
    }
  </style>
</head>
